import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';



class App extends Component {
  constructor(props){
    super(props)
  }

  render(){
    let data = this.state.data.map((object, i) =>{
      return <h2>{object}</h2>
      })
    return (
      <div className="App">
        <header className="App-header">
          <h1>{this.props.data}</h1>
          test
          {this.props.children}
        </header>
      </div>
    );
  }
}

export default App;
